import React from 'react';
import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';

const Note = (props) => {
    return (
        <>
            <p>{props.title}</p>
            <p>{props.content}</p>
            <Button color="primary" onClick={props.delfunc}><DeleteIcon /></Button>

        </>
    );
}

export default Note;
